import React from 'react'
import TeamiNfo from '../../Elements/teaminfo';



const Header = (props) => {

    const teamInfo =(team) => {
        return  team ? (
            <TeamiNfo team={team}/>
        )


        :null;
    }




    return (
        <div>
            {teamInfo(props.teamData)}
        </div>
    )
}


export default Header;
